import React from "react";

export const handleLogout = (onLogout) => {
  localStorage.removeItem("user");
  if (onLogout) onLogout();
};

const Logout = ({ onLogout }) => {
  return (
    <div>
      <button onClick={() => handleLogout(onLogout)}>Logout</button>
    </div>
  );
};

export default Logout;
